import React, { Component, useState } from 'react';
import logo from './logo.svg';
import './App.css';

function useInput(defaultValue) {
  const [Value, setValue] = useState(defaultValue);

  const onChange = (e) => {
    const {
      target: { Value },
    } = e;
    setValue(Value);
  };

  return { Value, onChange };
}

function App() {
  return (
    <div className='App'>
      <h1>USE HOOKS!!</h1>
    </div>
  );
}

export default App;
